import React from "react";
import "./Home.css";
import { Carousel } from "react-responsive-carousel";
import "react-responsive-carousel/lib/styles/carousel.min.css";

const HomePage = () => {
  return (
    <div>
      {/* Header */}
      <header className="header">
        <h1>College Chronicle</h1>
        <button className="login-button">Login</button>
      </header>

      {/* Main Content */}
      <main className="main-content">
        {/* Welcome Text */}
        <div className="welcome-text">
          <h2>Welcome to College Chronicle</h2>
        </div>

        {/* Image Carousel */}
        <Carousel
          showThumbs={false}
          infiniteLoop={true}
          autoPlay={true}
          interval={3000}
          showStatus={false}
        >
          <div>
            <img src="https://via.placeholder.com/800x400" alt="Campus 1" />
            <p className="legend">Campus Life</p>
          </div>
          <div>
            <img src="https://via.placeholder.com/800x400" alt="Campus 2" />
            <p className="legend">Events</p>
          </div>
          <div>
            <img src="https://via.placeholder.com/800x400" alt="Campus 3" />
            <p className="legend">Learning Spaces</p>
          </div>
        </Carousel>
      </main>
    </div>
  );
};

export default HomePage;
